create table t_summary_dept_monthly
(
    id                      BIGINT(19) auto_increment
        primary key,
    dept_id                 BIGINT(19)                              not null comment '辖区id',
    summary_month           INT(10)                                 not null comment '年月',
    dept_name               VARCHAR(256)                            null comment '辖区名称',
    self_riding_miles       DOUBLE(22, 0) default 0                 null comment '本辖区骑行里程',
    self_riding_duration    DOUBLE(22, 0) default 0                 null comment '本辖区骑行时长(单位秒)',
    self_patrol_count       INT(10)       default 0                 null comment '本辖区巡逻人次(订单数量)',
    self_task_count         INT(10)       default 0                 null comment '本辖区总任务数量',
    self_finish_task_count  INT(10)       default 0                 null comment '本辖区完成任务数量',
    self_car_used_rate      DOUBLE(22, 0) default 0                 null comment '本辖区车辆使用率(小于1的实际比率)',
    whole_riding_miles      DOUBLE(22, 0) default 0                 null comment '本辖区及下级辖区骑行里程',
    whole_riding_duration   DOUBLE(22, 0) default 0                 null comment '本辖区及下级辖区骑行时长(单位秒)',
    whole_patrol_count      INT(10)       default 0                 null comment '本辖区及下级辖区巡逻人次',
    whole_task_count        INT(10)       default 0                 null comment '本辖区及下级辖区总任务数量',
    whole_finish_task_count INT(10)       default 0                 null comment '本辖区及下级辖区完成任务数量',
    whole_car_used_rate     DOUBLE(22, 0) default 0                 null comment '本辖区及下级辖区车辆使用率',
    create_time             DATETIME(19)  default CURRENT_TIMESTAMP null,
    remark                  VARCHAR(1024)                           null,
    constraint AK_summary_dept_monthly_key_2
        unique (dept_id, summary_month)
)
    collate = utf8mb4_unicode_ci;

